import styled from "styled-components";

export default function Form() {
  return (
    <form>
      <fieldset>
        <legend>Write me</legend>
        <FormInput labelFor="nameInput" type="text" placeholder="Peppa Pig">
          First name:{" "}
        </FormInput>
        <label htmlFor="textarea">Comment: </label>
        <textarea
          name="textarea"
          type="text"
          placeholder="Like your projects!"
        ></textarea>
        <datalist>
          <option></option>
        </datalist>
        <button type="submit">Send</button>
      </fieldset>
    </form>
  );
}

function FormInput({ labelFor, children, type, placeholder }) {
  return (
    <>
      <label htmlFor={labelFor}>{children}</label>
      <input name={labelFor} type={type} placeholder={placeholder}></input>
    </>
  );
}

function FormDatalist(value) {
  return <option value={value} />;
}
